import React from 'react';
import { useStore } from './store';

export const SubmitButton = () => {
  const { getNodeCount, getEdgeCount } = useStore((state) => ({
    getNodeCount: state.getNodeCount,
    getEdgeCount: state.getEdgeCount,
  }));

  return (
    <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
      <button type="button" onClick={() => console.log(`Nodes: ${getNodeCount()}, Edges: ${getEdgeCount()}`)}>
        Submit
      </button>
    </div>
  );
};
